import unittest
from unittest.mock import patch, ANY
from .fixture import gateway

import karrio
import karrio.lib as lib
import karrio.core.models as models


class TestTNTShipping(unittest.TestCase):
    def setUp(self):
        self.maxDiff = None
        self.ShipmentRequest = models.ShipmentRequest(**ShipmentPayload)

    def test_create_shipment_request(self):
        request = gateway.mapper.create_shipment_request(self.ShipmentRequest)

        self.assertEqual(request.serialize(), ShipmentRequest)

    def test_create_shipment(self):
        with patch("karrio.mappers.tnt.proxy.lib.request") as mock:
            mock.side_effect = [ShipmentResponse, LabelResponse, RenderLabelResponse]
            karrio.Shipment.create(self.ShipmentRequest).from_(gateway)

            self.assertEqual(
                mock.call_args_list[0][1]["url"],
                f"{gateway.settings.server_url}/expressconnect/shipping/ship",
            )
            self.assertEqual(
                mock.call_args_list[1][1]["url"],
                f"{gateway.settings.server_url}/expresslabel/documentation/getlabel",
            )
            self.assertEqual(
                mock.call_args_list[2][1]["url"],
                f"{gateway.settings.server_url}/expresswebservices-website/app/render.html",
            )

    def test_parse_shipment_response(self):
        with patch("karrio.mappers.tnt.proxy.lib.request") as mock:
            mock.side_effect = [ShipmentResponse, LabelResponse, RenderLabelResponse]
            parsed_response = (
                karrio.Shipment.create(self.ShipmentRequest).from_(gateway).parse()
            )

            self.assertListEqual(lib.to_dict(parsed_response), ParsedShipmentResponse)


if __name__ == "__main__":
    unittest.main()


